import React, { Component } from 'react';
import axios from "axios";

export default class B extends Component {
    constructor (props) {
        super(props)
        this.state = {
            tekkom: [],
            visible: false
            };
    }

    componentDidMount() {
        axios({
            method: "get",
            url: "https://api12sbkkel9.herokuapp.com/data",
            headers: {
            accept: "*/*",
            },
        })
        .then((data) => {
            // data.json();
            this.setState({
                tekkom: data.data,
            });
        })
        .catch((error) => {
            console.log(error);
        });
    };
    
}
